import styled from 'styled-components';

const StyledIcon = styled.i`
  background: green;
  color: #fff;
  height: 40px;
  border-radius: 50%;
  width: 40px;
  display: inlin-flex;
  align-items: center;
  justify-content: center;
  text-align: center;
`;

export default StyledIcon;
